  showForm() {
    <CvEdExp display="block"/>
  }


  render() {

    return (
      <div className="containerBase">
      <h1>CV Application</h1>
      <button onClick={this.showForm()} className="createCvBtn">+</button>
      <CvEdExp display="block"/>
      </div>
    );
  }

}


export default App;
